package com.rongke.model;import com.baomidou.mybatisplus.annotations.TableField;import com.baomidou.mybatisplus.annotations.TableId;import com.baomidou.mybatisplus.annotations.TableName;import com.baomidou.mybatisplus.enums.IdType;import java.io.Serializable;import java.util.List;/** * @AdminRole * @(admin_role) * @version : Ver 1.0 */@TableName("admin_role")public class AdminRole implements Serializable {	@TableField(exist = false)	private static final long serialVersionUID = 1L;	/**	 * @备注:主键id	 * @字段:id BIGINT(19)	 */	@TableId(type = IdType.AUTO)	private java.lang.Integer id;	/**	 * @备注:	 * @字段:name VARCHAR(128)	 */	private java.lang.String name;	/**	 * @备注:是否可用,1：可用，2不可用	 * @字段:available CHAR(1)	 */	private java.lang.String available;	private java.lang.Integer type;	/**	 * 权限参数	 */	@TableField(exist = false)	private String auth;	public AdminRole(){	}	public AdminRole(		java.lang.Integer id	){		this.id = id;	}	public Integer getId() {		return id;	}	public void setId(Integer id) {		this.id = id;	}	public void setName(java.lang.String name) {		this.name = name;	}	public java.lang.String getName() {		return this.name;	}	public Integer getType() {		return type;	}	public void setType(Integer type) {		this.type = type;	}	public void setAvailable(java.lang.String available) {		this.available = available;	}	public java.lang.String getAvailable() {		return this.available;	}	public String getAuth() {		return auth;	}	public void setAuth(String auth) {		this.auth = auth;	}}